};

const mobile = () => {
  setImage('https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRhf9BlMjCof9Xnn2rFNPuEZy8sR4JVgNaq0w&usqp=CAU');
};

  return (
    <div>
        <h1>
            This is the content Present in the About Component.
        </h1>

        <div>
  <img src={image} alt="image" />

  <br />
  <button onClick={laptop}>Laptop</button> &nbsp;
  <button onClick={mobile}>Mobile</button>
  <br /> <br />
</div>


    </div>
  )
}
